import React from 'react'
import FullCalendar from '@fullcalendar/react'
import dayGridPlugin from '@fullcalendar/daygrid'
import interactionPlugin from '@fullcalendar/interaction'
import googleCalendarPlugin from '@fullcalendar/google-calendar';

export default class EventCalendar extends React.Component {
  render() {
    return (
        <div>
            <nav>
                <div className="form-check form-check-inline nowrap">
                    <a className="nav-link" href="/"> Home</a> |
                    <a className="nav-link" href="/progile"> Profile</a> |
                    <a className="nav-link" href="/signout"> Sign Out</a>
                </div>
        
             </nav>
            
            <FullCalendar 
                    defaultView="dayGridMonth" 
                    plugins={[dayGridPlugin, interactionPlugin, googleCalendarPlugin]}
                    editable={true}
                    id = 'calendar'
                    googleCalendarApiKey = 'AIzaSyDk4csiNvSTyVQE3aMZOZFJpqHuCasyqUg'
                    events = {'c_4hamaug2ns0tcivss6kg3hk2ug@group.calendar.google.com'}
      />

        </div>
   
    )}
  
}
